import React, { useState } from "react";
import CalWrapper from "../CalWrapper/CalWrapper";

const Cal = () => {

  const [inputVal1, setInputVal1] = useState(0);
  const [operationValue] = useState();
  const [] = useState();
  
  const allBtArr = [
    {
      value: 0,
      btFun: () => {
        setInputVal1((prev) => (
          parseInt(prev.toString() + 0)) // Add 0 to the input value
       );
      },
    },
    {
      value: 1,
      btFun: () => {
        setInputVal1((prev) => (
          parseInt(prev.toString() + 1)) // Add 1 to the input value
       );
      },
    },
    {
      value: 2,
      btFun: () => {
        setInputVal1((prev) => (
          parseInt(prev.toString() + 2)) // Add 2 to the input value
       );
      },
    },
    {
      value: 3,
      btFun: () => {
        setInputVal1((prev) => (
           parseInt(prev.toString() + 3)) // Add 3 to the input value
        );
      },
    },
    {
      value: 4,
      btFun: () => {
        setInputVal1((prev) => (
          parseInt(prev.toString() + 4)) // Add 4 to the input value
       );
      },
    },
  ];

  const operatonArr = [
    {
      value: "+",
      btFun: () => {
        setInputVal1((prev) => (
          parseInt(prev.toString() + 0)) 
       );
      },
    },
  ];

  return (
    <div>
      <p>This is Cal {inputVal1}</p>
      <CalWrapper allBtArr={allBtArr} />
    </div>
  );
};

export default Cal;
